import React from 'react';
import HeroSection from '../../components/HeroSection';
import PageLayout from '../../components/PageLayout';
import InfoCard from '../../components/InfoCard';
import ChakrasData from '../../data/ChakrasData';

const Chakras = () => {
  return (
    <PageLayout>
      <HeroSection title="Chakras" subtitle="Energy centers that balance mind, body, and spirit" />
      <div className="info-page-container">
        {ChakrasData.map((item, index) => (
          <InfoCard
            key={index}
            title={item.title}
            image={item.image}
            description={item.description}
            bioChemicals={item.bioChemicals}
            benefits={item.benefits}
          />
        ))}
      </div>
    </PageLayout>
  );
};

export default Chakras;
